import React from "react";
import "./dashboard.css";

export const Dashboard = () => {
  return (
    <div className="content">
      <div className="card">
        <div className="card-top">
          <img className="card__picture" />
          <p>Report for</p>
          <p className="card__name"></p>
        </div>
        <div className="card-bottom">
          <ul className="card__list">
            <li className="card__list card__list--active">Daily</li>
            <li className="card__list card__list--active">Weeekly</li>
            <li className="card__list card__list--active">Monthly</li>
          </ul>
        </div>
      </div>
    </div>
  );
};
